import { Link } from "react-router-dom";

const PRODUCTS = [
  { id: 1, name: "Product 1" },
  { id: 2, name: "Product 2" },
  { id: 3, name: "Product 3" },
];

export default function ProductsDetails() {
  return (
    <div>
      <h1>Products ⌚️</h1>
      <ul>
        {PRODUCTS.map((proudctDetails) => {
          <li key={proudctDetails.id}>
            <Link>{proudctDetails.id}</Link>
          </li>;
        })}
      </ul>
    </div>
  );
}
